        //屏蔽字符
        function filterChar(field, filter) {
            if (!field) {
                return;
            }

            var filedObj = null;
            if (typeof field == 'string') {
                filedObj = $("#" + field);
            } else if (typeof field == 'object') {
                filedObj = $(field);
            }

            if (filter) {
                var value = filedObj.val();
                if (filter.test(value)) {
                    value = value.replace(filter, '');
                    filedObj.val(value);
                }
            }
            return;
        }

